import React from "react";
import { FaBars, FaTwitter } from "react-icons/fa";

const SideBar = () => {
  return <div></div>;
};

export const Navbar = () => {
  return (
    <div>
      <nav>
        <div className="nav-center">
          <div className="nav-header" />
          {/* <img src={logo} alt="logo"></img>  */}
          <button className="nav-toggle">
            <FaBars />
          </button>
        </div>
        <div className="links-container show-container">
          <ul className="links">
            <li>
              <a href="#">home</a>
            </li>
            <li>
              <a href="#">about</a>
            </li>
            <li>
              <a href="#">contact</a>
            </li>
            <li>
              <a href="#">products</a>
            </li>
          </ul>
        </div>
        <ul className="social-icons">
          <li>
            <a target="_blank" href="https://www.twitter.com">
              <FaTwitter />
            </a>
          </li>
          <li>
            <a target="_blank" href="https://www.twitter.com">
              <FaTwitter />
            </a>
          </li>{" "}
          <li>
            <a target="_blank" href="https://www.twitter.com">
              <FaTwitter />
            </a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export const NavApp = () => {
  return (
    <React.Fragment>
      <Navbar></Navbar>
      <SideBar></SideBar>
    </React.Fragment>
  );
};
